import React, { Component } from 'react'

class TodoList extends Component {
    render() {
        return(
            <div>
                <input/>
                <button>提交</button>
                <ul>
                    <li>学英语</li>
                    <li> learn english</li>
                </ul>
            </div>
        );
    }
}

export default TodoList;
